import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./components/login.js";  // The login component
import Dashboard from "./components/dashboard.js";  // The dashboard component
import ResumeGenerator from "./resumeGenerator.js"
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/resume-generator" element={<ProtectedRoute><ResumeGenerator /></ProtectedRoute>} />

      </Routes>
    </Router>
  );
}

export default App;
